import React from 'react'
import Layout from './../components/Layout';

const projects = [
	{
		name: "Rex",
		description: ["An all in one Google CLI Application that can: ", "Parse the mail body for dates and then add a Google Calendar Event", "Parse Medium Daily Digest Mails and open blog links in the browser.", "Upload, download and share files on Google Drive", "Maintain a record of all applied internships/jobs", "Manage Todos"], 
		technologies: ["Node.js", "Javascript", "GMAIL API","Google Drive API","Google Calendar API."]
	},
	{
		name: "Cura (Google Build For Digital India)",
		description: ["Cura is an application that lets users add the food items they are allergic to and predicts the ingredient/item responsible, using Apriori algorithm.","My team was amongst the 61 teams selected across India from 3.3k+ teams."],
		technologies: ["Javascript", "React", "Node.js", "Python", "Firebase ML Kit", "Firebase"]
	},
	{
		name: "Study Jamm",
		description: ["A MERN Stack application that lets users ﬁnd mentors in their vicinity.","It was up and running for 6 days, during which it had 60 users registered on the platform and around 8 active users on the day of project evaluation."],
		technologies: ["MongoDB", "React", "Node.js", "Express", "Openlayers Map"]
	}
]

export default class Projects extends React.Component {
    
    render() {
        return (
            <Layout>
                <div>Hello There!</div>
            </Layout>
        )
    }
}
